import {Fragment} from "react";
import {createElement} from "react";
import './SearchForCity.css';
import json from "./cities.json";
import menu from "./images/Menu.png";

function SearchForCity() {
    const __COMPONENT__ = 'SearchForCity';
    const __CITY__ = 'Александровск-Сахалинский';
    let lengthOfCityName = `min-height:${__CITY__.length}px`;

    const arr = [
        "Ростов-на-Дону",
        "Казань",
        "Рязань",
        "Москва",
        "Петропавловск",
        "Мухосранск",
        "Ереван",
        "Абовян"
    ];
    return (
        <Fragment>
            <select>
                <option>{arr[0]}</option>
                <option>{arr[1]}</option>
                <option>{arr[2]}</option>
                <option>{arr[3]}</option>
                <option>{arr[4]}</option>
                <option>{arr[5]}</option>
                <option>{arr[6]}</option>
                <option>{arr[7]}</option>
            </select>
        </Fragment>
    );
}

export default  SearchForCity;
